import samo from './samo.jpeg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img id="profile__img" src={samo} className="App-logo img-fluid border rounded-circle img-thumbnail" alt="logo" />
        <p id="twitter">
          Twitter: Samuel26541199
        </p>
        {/* <input id="slack" type="hidden">
          Slack: Ayibanimi Ikoli
        </input> */}
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
